import React from 'react'

const BirthdayToday = ({ people }) => {
    const divStyleCard = {
        width: "18rem",
    }
    return (
        <>
            {people.map((person) => {
                const { id, name, birthday } = person;
                return (
                    <div className="col-sm-6 col-md-4 justify">
                        <div key={id} className="card m-4" style={divStyleCard}>
                            <img className="card-img-top" src="" alt={name} />
                            <div className="card-body">
                                <h5 className="card-title">{name}</h5>
                                <p className="card-text">{birthday}</p>
                                <button className="btn btn-primary">Remove</button>
                            </div>
                        </div>
                    </div>
                )
            })}
        </>
    )
}

export default BirthdayToday
